import React, { useEffect, useState } from "react";
import axios from "axios";

export default function Store() {
    const [ambulance, setAmbulances] = useState([]);
    const [no_plate, setNoPlate] = useState("");
    const [driver, setDriver] = useState("");
    const [oxygen, setOxygen] = useState("");
    const [qambulance, setQambulance] = useState("");

    useEffect(() => {
        axios.get("http://localhost:8080/ambulance/all")
            .then(response => setAmbulances(response.data))
            .catch(error => console.error("Error fetching users:", error));
    }, []);

    const ambulanceQuery = async () => {
        try {
            const response = await axios.get(`http://localhost:8080/ambulance/get/${no_plate}`);
            console.log("Ambulance found:", response.data);
            setQambulance([response.data]);
        } catch (error) {
            console.error("Error fetching ambulance:", error);
        }
    }
    const handleSubmit = (e) => {
        e.preventDefault();
        ambulanceQuery();
    }

    return (
        <div>
            <div>
                <br />
                <br />
                <br />
                <br />
                <h2>Ambulances List</h2>
                <h2>Here they are</h2>
            </div>
            <ul>
                <br />
                <br />
                {ambulance.map(user => (
                    <li key={user.ambulance_num_plate}>
                        Number Plate: {user.ambulance_num_plate}
                        <br />
                        Driver contact no: {user.driver_contact}
                        <br />
                        Oxygen ase naki? ({user.oxygen_status})
                    </li>
                ))}
            </ul>

            <div>
                <h2>Search for ambulance</h2>

                <form onSubmit={handleSubmit}>
                      <label>
                        No Plate:
                        <input
                          type="text"
                          value={no_plate}
                          onChange={(e) => setNoPlate(e.target.value)}
                        />
                      </label>
                      <button type="submit">Search</button>
                    </form>
            </div>
        </div>
    );
}
